enum ContractError {
    Std(StdError),
    Unauthorized {
        },
    Claimed {
        },
    Expired {
        },
    ApprovalNotFound {
            spender: String,
        },
}

fn send_nft<'_,
'_>(&'_ Self, DepsMut, Env, MessageInfo, String, String, Binary)
-> Result<Response<C>, ContractError>

fn approve<'_,
'_>(&'_ Self, DepsMut, Env, MessageInfo, String, String, Option<Expiration>)
-> Result<Response<C>, ContractError>

fn approve_all<'_,
'_>(&'_ Self, DepsMut, Env, MessageInfo, String, Option<Expiration>)
-> Result<Response<C>, ContractError>

fn _transfer_nft<'_, '_, '_, '_, '_,
'_>(&'_ Self, DepsMut, &'_ Env, &'_ MessageInfo, &'_ str, &'_ str)
-> Result<TokenInfo<T>, ContractError>

fn _update_approvals<'_, '_, '_, '_, '_,
'_>(&'_ Self, DepsMut, &'_ Env, &'_ MessageInfo, &'_ str, &'_ str, bool,
Option<Expiration>) -> Result<TokenInfo<T>, ContractError>

fn check_can_approve<'_, '_, '_, '_,
'_>(&'_ Self, Deps, &'_ Env, &'_ MessageInfo, &'_ TokenInfo<T>)
-> Result<(), ContractError>

fn check_can_send<'_, '_, '_, '_,
'_>(&'_ Self, Deps, &'_ Env, &'_ MessageInfo, &'_ TokenInfo<T>)
-> Result<(), ContractError>

fn all_operators<T, '_, '_,
'_>(&'_ Self, &'_ QuerierWrapper, T, bool, Option<String>, Option<u32>)
-> StdResult<Vec<Approval>> where T: Into<String>

fn tokens<T, '_, '_,
'_>(&'_ Self, &'_ QuerierWrapper, T, Option<String>, Option<u32>)
-> StdResult<TokensResponse> where T: Into<String>

fn all_tokens<'_, '_,
'_>(&'_ Self, &'_ QuerierWrapper, Option<String>, Option<u32>)
-> StdResult<TokensResponse>

enum ExecuteMsg<T, E> {
    TransferNft {
            recipient: String,
            token_id: String,
        },
    SendNft {
            contract: String,
            token_id: String,
            msg: Binary,
        },
    Approve {
            spender: String,
            token_id: String,
            expires: Option<Expiration>,
        },
    Revoke {
            spender: String,
            token_id: String,
        },
    ApproveAll {
            operator: String,
            expires: Option<Expiration>,
        },
    RevokeAll {
            operator: String,
        },
    Mint(MintMsg<T>),
    Burn {
            token_id: String,
        },
    Extension {
            msg: E,
        },
}

enum QueryMsg<Q> {
    OwnerOf {
            token_id: String,
            include_expired: Option<bool>,
        },
    Approval {
            token_id: String,
            spender: String,
            include_expired: Option<bool>,
        },
    Approvals {
            token_id: String,
            include_expired: Option<bool>,
        },
    AllOperators {
            owner: String,
            include_expired: Option<bool>,
            start_after: Option<String>,
            limit: Option<u32>,
        },
    NumTokens {
        },
    ContractInfo {
        },
    NftInfo {
            token_id: String,
        },
    AllNftInfo {
            token_id: String,
            include_expired: Option<bool>,
        },
    Tokens {
            owner: String,
            start_after: Option<String>,
            limit: Option<u32>,
        },
    AllTokens {
            start_after: Option<String>,
            limit: Option<u32>,
        },
    Minter {
        },
    Extension {
            msg: Q,
        },
}

fn operators<'_,
'_>(&'_ Self, Deps, Env, String, bool, Option<String>, Option<u32>)
-> StdResult<OperatorsResponse>
